import React from 'react';
import Header from '../../Components/header/Header';
import Footer from '../../Components/footer/Footer';
import CardProduct from '../../Components/card_product/Card_product';
import './home.css';

const Home = () => {
    return (
        <div>
            <Header />
            <div className='container'>
            <CardProduct />
            </div>
           

            <Footer />

        </div>
    );
}

export default Home;
